											<h3 style="color: #4f4f4f;">Производство металлоизделий</h3>
 В 2007 году компания «Байс» модернизировала производство по металлообработке и изготовлению изделий из тонколистового металла – вентиляционных заготовок, водосточных систем, фальцевой кровли и кровельных комплектующих. Также было приобретено оборудование для&nbsp;плазменной резки и раскроя листового металла. Изделия изготавливаются на импортном электронном оборудовании марки «SСHEСHTL» (Германия), «SPIRO» (Швейцария), «RAS» (Германия), «P.E.I.POINT» (Италия), «Mercur» (Италия).
<p>
	 Модернизированное производство позволяет выпускать воздуховоды для вентиляционных систем и комплектующие для кровли и фасада в 5 раз больше и быстрее, чем при ручном изготовлении.
</p>						</div>

